int getWavData(char* wavPath, pWAVHeader header, short** data)
{
long len;

FILE* fIn = fopen(wavPath, "rb");
len = fread(header, sizeof(WAVHeader), 1, fIn);

*data = malloc(header->subchunk2Size);

len = fread(*data, header->subchunk2Size, 1, fIn);

fclose(fIn);

return 0;
}

